script: |
  super -f text -I q468.spq | sort > q468.out

inputs:
  - name: q468.spq
    data: |
      SELECT DISTINCT col0 FROM tab2 (FORMAT parquet) WHERE NOT - col2 BETWEEN - col2 * + + ( + - ( col1 ) ) AND + - ( 83 );
  - name: tab2

outputs:
  - name: q468.out
    data: |
      46
      64
      75
